import React from "react";

import './WelcomePage.css';
import GenerateSch from "../GenerateSchedulePage/GenerateSchedulePage";

const WelcomePage = props => {
    return (
        <section className="WelcomePage-section">
            <h1>
                Welcome to the Ant System Generate Schedule Website. Click "start" button to start generating schedule
            </h1>
            <Router>
                <button onClick="/frontend/src/components/GenerateSchedulePage/GenerateSchedulePage.js">START</button>
            </Router>
                
        </section>
    );
};

export default WelcomePage;
